script: |
  super -f text -I q768.spq | sort > q768.out

inputs:
  - name: q768.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE + ( + col0 ) NOT BETWEEN + col2 + - - col1 AND - - ( col2 ) + - - 96;
  - name: tab1

outputs:
  - name: q768.out
    data: |
      51	14	96
      91	47	68
